import './navitems.css'



const NavItem = (props) => {
  return (
<li  className='nav-item'>
    {props.children}
</li>
  )
}




const NavItemDropDown = (props) => {
    return (
  <li className='dropdown-item'>
      {props.children}
  </li>
    )
  }

export default NavItem
export {NavItemDropDown}
